var express = require("express");
var app = express();
var bodyParser = require("body-parser");

app.use(bodyParser.urlencoded({ extended: true }));
app.set("view engine", "ejs");
var campgrounds = [
  {
    name: "Pankise Camp",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "Turkey Camp",
    image: "https://i.hurimg.com/i/hdn/75/0x0/59c854c745d2a027e83bdb36.jpg",
  },
  {
    name: "Bhedaghat Camp",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "Perfect  Camp",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "Marrwan Camp",
    image:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSWSmVtO0b2bC9jH7lTXLX_sL_qAe-_Qju_xA&usqp=CAU",
  },
];
app.get("/", (req, res) => {
  res.render("landing");
});

app.get("/campgrounds", (req, res) => {
  res.render("campgrounds", { varCamp: campgrounds });
});

app.post("/campgrounds", (req, res) => {
  var name = req.body.name;
  var image = req.body.url;
  var newCamp = { name: name, image: image };
  campgrounds.push(newCamp);
  res.redirect("/campgrounds");
});

app.get("/campgrounds/new", (req, res) => {
  res.render("new");
});

app.listen("5001", () => {
  console.log("Yelp server has started!");
});
